           isSlidesView: UrlUtil.getVariableValue(window.location.href, "slidesView"),
           dataProvider: dataProvider,
           enableDataDrilling: true,
           resizeMode: PlayerResizeModes.FIT_WINDOW,
           defaultZoomBehavior: PlayerZoomBehaviors.FIT_PAGE,
           onError: function(e) {
                0 && console.log(e);
           }
       }).placeAt(layoutNode);
       when(dataProvider.reportDataFromJson(reportDataJson), function (reportData) {
           player.setReportData(reportData);
       });
   });
});
</script>
